import React from 'react';
import './First.css';
import img1 from '../../images/one.jpeg';
import img2 from '../../images/two.jpeg';
export default function First(){
     return(
        <>
             <div className="f-wrapper">
                <div className="f1">
                    <img src={img1} alt="" className='f-img' />
                </div>
                <div className="f2">
                    <img src={img2} alt="" className='f-img2' />
                    <div className="f2-text">
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Animi iste sapiente porro. Dolorem magnam necessitatibus possimus? Ipsum corrupti repudiandae earum quis eos illum excepturi vitae error blanditiis a consequatur, perspiciatis at quasi debitis, accusantium similique suscipit, ducimus quod dolore. Quo vitae dignissimos praesentium blanditiis dolor doloribus culpa distinctio nostrum laudantium!
                    </div>
                </div>
             </div>
        </>
     )
}
